/* Working with Web3 Storage */

async function storeIPFS() {
  try {
    const { File, Web3Storage } = require("web3.storage");

    const client = await new Web3Storage({ token: key });
    const fileToUpload = await new File([data], "cert.png");

    console.log(fileToUpload)
    const files = [fileToUpload];

    /* Make req to upload to IPFS */
    const cid = await client.put(files,  { wrapWithDirectory: false });
    console.log("stored files with cid:", cid);
  } catch (error) {
    console.error(error);
  }
}


function makeFileObjects() {
  const Storage = require("web3.storage");

  // You can create File objects from a Buffer of binary data
  // see: https://nodejs.org/api/buffer.html
  // Here we're just storing a JSON object, but you can store images,
  // audio, or whatever you want!
  const obj = { hello: 'world' }
  const buffer = Buffer.from(JSON.stringify(obj));

  const files = [
    new Storage.File(['contents-of-file-1'], 'plain-utf8.txt'),
    new Storage.File([buffer], 'hello.json')
  ]
  console.log(files)
}


